    const imageUrl = data?.i?.imageUrl || defaultImageUrl;

    return (
        <div className="card" onClick={onClick}>
            {data ? (
                <>
                    <figure>
                        <img src={imageUrl} alt={data.l} />
                    </figure>
                    <div className="card-info">
                        <h3>{data.l}</h3>
                        <p>{data.q}</p>
                    </div>
                </>
            ) : (
                <p>Loading...</p>
            )}
        </div>
    );
}
